def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)
    for i in range(len(bins)):
        if item <= bins[i]/3:
            if item % 2 == 0:
                priorities[i] = np.sin(item / bins[i]) + np.cos(item / bins[i])
            elif item % 2 == 1:
                priorities[i] = np.sqrt(item / bins[i]) + np.cbrt(item / bins[i])
            else:
                priorities[i] = np.exp(item / bins[i]) + np.log(item / bins[i])
        elif item > bins[i]/3 and item <= bins[i]*2/3:
            if item % 3 == 0:
                priorities[i] = np.tan(item / bins[i]) + np.arctan(item / bins[i])
            elif item % 3 == 1:
                priorities[i] = np.tanh(item / bins[i]) + np.arctanh(item / bins[i])
            else:
                priorities[i] = np.sinh(item / bins[i]) + np.cosh(item / bins[i])
        else:
            if item % 4 == 0:
                priorities[i] = np.tan(np.log(item / bins[i])) + np.log(np.tan(item / bins[i]))
            elif item % 4 == 1:
                priorities[i] = np.arcsin(item / bins[i]) + np.arccos(item / bins[i])
            elif item % 4 == 2:
                priorities[i] = np.arcsinh(item / bins[i]) + np.arccosh(item / bins[i])
            else:
                priorities[i] = np.tanh(np.log(item / bins[i])) + np.log(np.tanh(item / bins[i]))

    return priorities
